import { HashRouter as Router, Routes, Route } from "react-router-dom";
import Home from '../Pages/Home.jsx'; // ✅ relative path
import Search from '../Pages/Search.jsx'; //

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />}/>
      </Routes>
    </Router>
  );
}

export default App;
